/*
插件：视频弹窗
版本：
官网：
*/
function HiVideoPop(obj) {
    
    var oVideoBox = $("#hi-video-pop"); //弹窗
    var oClose = oVideoBox.find(".c-close"); //关闭按钮
    var oVideo = oVideoBox.find("video"); //视频标签
    // 点击显示弹窗，设置视频src，播放视频
    obj.each(function() {
        if($(this).attr("data-video-src")){
            $(this).click(function() {
                oVideoBox.stop().fadeIn();
                oVideo.attr("src", $(this).attr("data-video-src"));
                oVideo.trigger("play");
            });
        }
    });
    // 点击关闭弹窗，暂停视频播放
    oClose.click(function() {
        oVideo.trigger("pause");
        oVideoBox.stop().fadeOut();
    });
}

/*
插件：图片弹窗
版本：
官网：
*/
function HiImgPop(obj) {
    var oImgBox = $("#hi-img-pop"); //弹窗
    var oClose = oImgBox.find(".c-close"); //关闭按钮
    var oImg = oImgBox.find("img"); //图片标签
    // 点击显示弹窗，设置图片src
    obj.each(function() {
        if($(this).attr("data-img-src")){
            $(this).click(function() {
                oImgBox.stop().fadeIn();
                oImg.attr("src", $(this).attr("data-img-src"));
            });
        }
    });
    // 点击关闭弹窗
    oClose.click(function() {
        oImgBox.stop().fadeOut();
    });
}

/*
插件：视频全屏
版本：
官网：
*/
function HiVideoPop2(obj) {
    var oVideo = $("#hi-video-pop2"); //视频
    // 点击视频全屏，设置视频src，播放视频
    obj.each(function() {
        if($(this).attr("data-video-src")){
            $(this).click(function() {
                if (oVideo[0].requestFullscreen) {
                    oVideo[0].requestFullscreen();
                } else if (oVideo[0].msRequestFullscreen) {
                    oVideo[0].msRequestFullscreen();
                } else if (oVideo[0].mozRequestFullScreen) {
                    oVideo[0].mozRequestFullScreen();
                } else if (oVideo[0].webkitRequestFullScreen) {
                    oVideo[0].webkitRequestFullScreen();
                }
                oVideo.show();
                oVideo.attr("src", $(this).attr("data-video-src"));
                oVideo.trigger("play");
            });
            $(window).resize(function() {
                if (oVideo.outerHeight() == 0) {
                    oVideo.hide();
                    oVideo.trigger("pause");
                }
            });
        }
    });
}

/*
插件：简历弹窗
版本：
官网：
*/
function HiResumePop(obj,sText) {
    var oResumeBox = $("#hi-resume-pop"); //弹窗
    var oClose = oResumeBox.find(".c-close"); //关闭按钮
    var oText = oResumeBox.find(".hi-text"); //上传简历名
    var oInput = oResumeBox.find(".hi-file"); //上传文本框
    var sFileName = "";
    // 点击显示简历弹窗
    obj.each(function() {
        $(this).click(function() {
            oResumeBox.stop().fadeIn();
        })
    });
    // 点击关闭按钮，隐藏简历弹窗
    oClose.click(function(event) {
        event.stopPropagation();
        oResumeBox.stop().fadeOut();
    });

    // 设置上传文件名
    oInput.change(function(event) {
        sFileName = $(this).val().split('\\');
        sFileName = sFileName[sFileName.length - 1];
        oText.text(sText + sFileName);
    });
}


/*
插件：视频在可视区时播放
版本：
官网：
*/
function HiVideoPlay(obj1,obj2,nNum,bOnce) {
    var a = true;
    var b = true;
    if (obj1.length != 0) {
        $(window).scroll(function() {
            fn1();
        });
        function fn1(){
            if(b){
                if ($(window).scrollTop() > obj1.offset().top - $(window).height() + $(window).height()*nNum && $(window).scrollTop()<obj1.offset().top + obj1.outerHeight()) {
                    if(a){
                        a = false;
                        obj2.trigger("play");
                        if(bOnce){
                            b = false;
                        }
                    }
                }else{
                    a = true;
                    obj2[0].currentTime = 0;
                    obj2.trigger("pause");
                }
            }
        }
        fn1();
    }
}

/*
插件：元素在可视区时添加class
版本：
官网：
*/
function HiAddClass(obj1,obj2,nNum,sClass,bOnce) {
    var a = true;
    var b = true;
    if (obj1.length != 0) {
        $(window).scroll(function() {
            fn1();
        });
        function fn1(){
            if(b){
                if ($(window).scrollTop() > obj1.offset().top - $(window).height() + $(window).height()*nNum && $(window).scrollTop()<obj1.offset().top + obj1.outerHeight()) {
                    if(a){
                        a = false;
                        obj2.addClass(sClass);
                        if(bOnce){
                            b = false;
                        }
                    }
                }else{
                    a = true;
                    obj2.removeClass(sClass);
                }
            }
        }
        fn1();
    }
}

/*
插件：元素设置可视区一屏的高度
版本：
官网：
*/
function HiSetClientHeight(obj1) {
    if (obj1.length != 0) {
        obj1.each(function(){
            var _this = $(this);
            $(this).outerHeight($(window).height());
            $(window).resize(function(){
                _this.outerHeight($(window).height());
            });
        });
    }
}

